     <h2>Como chegar a Orlando</h2> 
     <p>
         Orlando é um dos destinos mais procurados entre os brasileiros que visitam os Estados Unidos e a diversidade de voos para a cidade é um grande facilitador para realizar a viagem. O Aeroporto Internacional de Orlando tem uma grande estrutura e, frequentemente, são encontradas tarifas promocionais para a cidade.
