American Airlines tem voos saindo dos aeroportos de Guarulhos (SP), Galeão (RJ), Brasília (DF), Manaus (AM), Salvador (BA), Porto Alegre (RS) e Curitiba (PR). Em dezembro de 2014, a Azul deve ter voos para Orlando. 
